import React from "react";
import ReactDom from 'react-dom';
import Joke from "./Jokes.js";

const Joker = (props) =>
{
  return <>
    <h1>{props.setup}</h1>
    <h2>{props.punchline}</h2>
    <hr></hr>
  </>
}



const Jokes = Joke.map(function(x)
{
  return (
    <Joker setup = {x.setup} punchline = {x.punchline}/>
  )
})


const Element = <>
  {Jokes}

</>




const root = ReactDom.createRoot(document.getElementById('root'));
root.render(Element)
